import React from "react";
import { motion } from "framer-motion";

export default function Home() {
  return (
    <div style={{ padding: 20, maxWidth: 1200, margin: "0 auto" }}>
      {/* Main Welcome */}
      <motion.h1
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7 }}
        style={{ color: "#0A84FF", fontSize: "3rem", fontWeight: "bold", marginBottom: 20 }}
      >
        Welcome to Cyberpidia
      </motion.h1>

      <motion.p
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1, delay: 0.3 }}
        style={{ fontSize: "1.25rem", lineHeight: 1.8, color: "#ffffffcc", marginBottom: 40 }}
      >
        Your ultimate cybersecurity hub with tools, courses, books, and guides to help you become a cybersecurity expert.
      </motion.p>

      {/* Section 1 */}
      <motion.div
        initial={{ opacity: 0, x: -50 }}
        animate={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.7, delay: 0.5 }}
        style={{ marginBottom: 40 }}
      >
        <h2 style={{ color: "#0af", fontSize: "2rem", marginBottom: 10 }}>1. What is Cyberpidia?</h2>
        <p style={{ color: "#e0e0e0", fontSize: "1.1rem" }}>
          Cyberpidia is a comprehensive platform that collects all cybersecurity resources in one place. From tools and books to online courses and tutorials, Cyberpidia guides you through every step of your learning journey.
        </p>
      </motion.div>

      {/* Section 2 */}
      <motion.div
        initial={{ opacity: 0, x: 50 }}
        animate={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.7, delay: 0.7 }}
        style={{ marginBottom: 40 }}
      >
        <h2 style={{ color: "#0af", fontSize: "2rem", marginBottom: 10 }}>2. Enhance Your Knowledge</h2>
        <p style={{ color: "#e0e0e0", fontSize: "1.1rem" }}>
          Access a wide variety of cybersecurity tools for learning and practice, browse curated books, and enroll in courses to boost your skills. Whether you want to explore penetration testing, network security, or ethical hacking, Cyberpidia has it all.
        </p>
      </motion.div>

      {/* Section 3 */}
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7, delay: 0.9 }}
        style={{ marginBottom: 40 }}
      >
        <h2 style={{ color: "#0af", fontSize: "2rem", marginBottom: 10 }}>3. Features & Resources</h2>
        <ul style={{ color: "#e0e0e0", fontSize: "1.1rem", lineHeight: 1.6 }}>
          <li><strong>Tools:</strong> Explore cybersecurity software and online utilities for learning and testing.</li>
          <li><strong>Books:</strong> Access beginner to advanced cybersecurity books to enhance your knowledge.</li>
          <li><strong>Courses:</strong> Learn from structured online courses, video tutorials, and certifications.</li>
          <li><strong>Guides & Roadmaps:</strong> Step-by-step guides and curated roadmaps for your cybersecurity journey.</li>
        </ul>
      </motion.div>

      {/* Section 4 */}
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7, delay: 1.1 }}
        style={{ marginBottom: 40 }}
      >
        <h2 style={{ color: "#0af", fontSize: "2rem", marginBottom: 10 }}>4. Start Your Cybersecurity Journey Today</h2>
        <p style={{ color: "#e0e0e0", fontSize: "1.1rem" }}>
          Whether you are a complete beginner or an advanced learner, Cyberpidia helps you get started with the right resources. Stay up to date with latest tools, techniques, and knowledge to advance in cybersecurity.
        </p>
      </motion.div>

      {/* CTA */}
      <motion.div
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.7, delay: 1.3 }}
        style={{ textAlign: "center", marginTop: 60 }}
      >
        <button
          style={{
            padding: "12px 30px",
            fontSize: "1.1rem",
            fontWeight: "bold",
            borderRadius: 8,
            border: "none",
            background: "#0A84FF",
            color: "#fff",
            cursor: "pointer",
            transition: "all 0.3s",
          }}
          onMouseEnter={(e) => (e.target.style.background = "#0666d0")}
          onMouseLeave={(e) => (e.target.style.background = "#0A84FF")}
        >
          Explore Now
        </button>
      </motion.div>
    </div>
  );
}
